import React, { useState } from "react";


const Inputname =()=>{
    // const name;
    const [cname,fname]=useState("");

    const typed =(event)=>{
        console.log(event.target.value);
        fname(event.target.value)
    }

    return(
        <>
            <h1>Hello{cname}</h1>
            <input type="text" onChange={typed} /><br/>
            <button>Click Me</button>
        </>
    )
}

export default Inputname;
